import React, { useState } from 'react';
import { useSearchParams } from 'react-router-dom';
function ViewUser() {
    const [searchParams] = useSearchParams();
    const name = searchParams.get("name");
    const phoneNumber = searchParams.get("phoneNumber");
    const email = searchParams.get("email");
    const address = searchParams.get("address");
    const status = searchParams.get("status");
    console.log(name, email, phoneNumber, address, "dsldkldkdkd", status)
    const [error, setError] = useState('');

    return (
        <div className="edit-category-container">
            <h2>View User</h2>
            {error && <p style={{ color: 'red' }}>{error}</p>}
            <form>
                <div className="form-group">
                    <label htmlFor="categoryName">User Name</label>
                    <input
                        type="text"
                        id="userName"
                        value={name}
                    />
                </div>
                <div className="form-group">
                    <label htmlFor="categoryName">Email</label>
                    <input
                        type="text"
                        id="email"
                        value={email ? email : 'N/A'}
                    />
                </div>
                <div className="form-group">
                    <label htmlFor="categoryName">Phone Number</label>
                    <input
                        type="text"
                        id="phoneNumber"
                        value={phoneNumber}
                    />
                </div>
                <div className="form-group">
                    <label htmlFor="categoryName">Address</label>
                    <input
                        type="text"
                        id="address"
                        value={address}
                    />
                </div>
                <div className="form-group" style={{ disabled: true }}>
                    <label htmlFor="status">Status:</label>
                    <select
                        id="status"
                        value={status}
                    >
                        {/* <option value="Active">Active</option> */}
                        {/* <option value="Inactive">Inactive</option> */}
                    </select>
                </div>
            </form>
        </div>
    );
}

export default ViewUser;
